import React, { useState } from 'react'
import Article from './Article'

const List = (props) => {
    const [list, setList] = useState(props.list);
    return(
        list.map(article =>
            <>
                {console.log(list)}
                <Article article={article}/>
            </>
        )
    )
}

export default List;
